import React from "react";

function Scoreboard() {
    return (
        <div className="scoreboard">
            <div className="userScore">Your Score: X</div>
            <div className="userScore" id="divider"> | </div>
            <div className="highScore">High Score: X</div>
        </div>
    );
};

export default Scoreboard;
